/**
 * @param {number[]} nums
 * @return {number}
 */
var findMaxLength = function (nums) {
    var maxLength = 0;
    for (var i = 0; i < nums.length; i++) {
        let zeroes = 0;
        let ones = 0;

        if (maxLength > (nums.length - (i + 1)))
            break;

        for (var j = i; j < nums.length; j++) {
            if (nums[j] === 1)
                ones++;
            else
                zeroes++;

            if (ones === zeroes) {
                 maxLength = Math.max(maxLength, j - i + 1)
            }
        }
    }
    return maxLength;


};


